import { Provider } from "react-redux";
import "./App.css";
import Header from "./components/Header/Header";
import List from "./components/List/List";
import Map from "./components/Map/Map";
import store from "./redux/Store";

const App = () => {
  return (
    <Provider store={store}>
      <Header />
      <div className="row">
        <div className="col s12 m4" style={{backgroundColor:'blue'}}>
          <List />
        </div>
        <div className="col s12 m8" style={{backgroundColor:'green'}}>
          <Map />
        </div>
      </div>
    </Provider>
  );
};

export default App;
